INSERT INTO `v1_4a82089e2148299b8ac93e2df3c5c84da05b5e76e53596a0aafb1becadfbae14` VALUES (24015, 0.0, 4, "あうぅ～残念さ～\nマジムンに魂を\n奪われちゃったかな～？", "2030/12/17 14:59:59", "カオリ（サマー）", 0.0, 0.0, 24, 1, 4, 110501, 10021, "2019/07/31 12:00:00");
INSERT INTO `v1_4a82089e2148299b8ac93e2df3c5c84da05b5e76e53596a0aafb1becadfbae14` VALUES (24016, 0.0, 4, "今日は踊りのキレも悪いよ～\nゴーヤーっぽいもの食べて、元気回復さ～！", "2030/12/17 14:59:59", "カオリ（サマー）", 4.0, 0.0, 24, 2, 1, 110501, 10021, "2019/07/31 12:00:00");
INSERT INTO `v1_4a82089e2148299b8ac93e2df3c5c84da05b5e76e53596a0aafb1becadfbae14` VALUES (24017, 0.0, 4, "マジムンだらけで目が回るさ～！\nふらふらさ～！", "2030/12/17 14:59:59", "カオリ（サマー）", 0.0, 0.0, 24, 3, 4, 110501, 10021, "2019/07/31 12:00:00");
INSERT INTO `v1_4a82089e2148299b8ac93e2df3c5c84da05b5e76e53596a0aafb1becadfbae14` VALUES (24018, 0.0, 1, "なんくるない、なんくるない\n次、頑張ればいいんだよ～！\n海で泳いで\nリフレッシュするさー！", "2030/12/17 14:59:59", "カオリ（サマー）", 5.2, 0.0, 24, 4, 2, 110501, 10021, "2019/07/31 12:00:00");
INSERT INTO `v1_4a82089e2148299b8ac93e2df3c5c84da05b5e76e53596a0aafb1becadfbae14` VALUES (24019, 0.0, 5, "恥ずかしいところ\n見られちゃったね～\n水着？　水着のことじゃないよー？", "2030/12/17 14:59:59", "カオリ（サマー）", 4.2, 0.0, 24, 5, 6, 110501, 10021, "2019/07/31 12:00:00");
INSERT INTO `v1_4a82089e2148299b8ac93e2df3c5c84da05b5e76e53596a0aafb1becadfbae14` VALUES (24020, 0.0, 2, "絶好調さ～！　この調子で\n海の平和を取り戻すよ～！\n楽しい夏が待ってるさ～！", "2030/12/17 14:59:59", "カオリ（サマー）", 0.0, 0.0, 24, 6, 2, 110501, 10021, "2019/07/31 12:00:00");
INSERT INTO `v1_4a82089e2148299b8ac93e2df3c5c84da05b5e76e53596a0aafb1becadfbae14` VALUES (24021, 0.0, 1, "何匹で襲ってきたって\n私はマブイを落っことさないよ～！\nくしゅん！　あ……\n今のくしゃみで落っこちたかも～？", "2030/12/17 14:59:59", "カオリ（サマー）", 6.4, 0.0, 24, 7, 6, 110501, 10021, "2019/07/31 12:00:00");
INSERT INTO `v1_4a82089e2148299b8ac93e2df3c5c84da05b5e76e53596a0aafb1becadfbae14` VALUES (24022, 0.0, 2, "ひーやーさーさー♪\n戦いの後は、踊りを踊って\n気分スッキリさ～！", "2030/12/17 14:59:59", "カオリ（サマー）", 0.0, 0.0, 24, 8, 2, 110501, 10021, "2019/07/31 12:00:00");
INSERT INTO `v1_4a82089e2148299b8ac93e2df3c5c84da05b5e76e53596a0aafb1becadfbae14` VALUES (24023, 0.0, 6, "あれ～？　戦ってるうちに\n水着がどっか行っちゃった～？\nねぇキミ、どっかで見なかった～？\nなんで離れるさ～？", "2030/12/17 14:59:59", "カオリ（サマー）", 10.08, 0.0, 24, 9, 3, 110501, 10021, "2019/07/31 12:00:00");
INSERT INTO `v1_4a82089e2148299b8ac93e2df3c5c84da05b5e76e53596a0aafb1becadfbae14` VALUES (24024, 0.0, 1, "まだまだ私は元気だよ～！\nマジムンでもなんでも、\nどんとこーいさー♪", "2030/12/17 14:59:59", "カオリ（サマー）", 5.0, 0.0, 24, 10, 2, 110501, 10021, "2019/07/31 12:00:00");
INSERT INTO `v1_4a82089e2148299b8ac93e2df3c5c84da05b5e76e53596a0aafb1becadfbae14` VALUES (24025, 0.0, 2, "私の空手は世界最強さ～！\n夏の陽射しと青い海も合わされば、\n向かうところ敵なしだよー！", "2030/12/17 14:59:59", "カオリ（サマー）", 0.0, 0.0, 24, 11, 2, 110501, 10021, "2019/07/31 12:00:00");
